import React,{ Component } from "react"
import Info from "./components/Information/Info"
import "./App.css"


export default class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      isServerConnected: false,
      isPotConnected: false,
      humidity:0,
      tempurature:0,
      lightness:0,
      weight:0,
      ph:0,
      speaker:0,
      motor:0,
      waterpump1:0,
      waterpump2:0
    }
  }


  render() {
    return (
      <div>
        <h1 className="title">Hex Future</h1>
        <div className="row">
          <Info/>
        </div>
      </div>
    )
  }
}
